        uint256 _tokenId,
        address _receiver,
        uint96 _percentage
    ) external onlyOwner {
        require(_percentage <= 100, "can't set more than 100%");
        uint96 feeNumerator = _percentage * 100;
        _setTokenRoyalty(_tokenId, _receiver, feeNumerator);
